import React, { useEffect, useState } from 'react';
import '../styles/PopupPage.css';

const PopupPage = ({ doctorId, onClose }) => {
  const [doctorDetails, setDoctorDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDoctorDetails = async () => {
      try {
        setLoading(true);
        setError(null);

        const response = await fetch(`http://127.0.0.1:8000/api/doctor/public-doctor-profiles/${doctorId}/`);
        if (!response.ok) throw new Error('Failed to fetch data');

        const data = await response.json();
        if (!data || Object.keys(data).length === 0) {
          setError('No data found for this doctor.');
        } else {
          setDoctorDetails(data);
        }
      } catch (err) {
        console.error('Error fetching doctor details:', err);
        setError('Failed to fetch doctor details. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchDoctorDetails();
  }, [doctorId]);

  if (!doctorId) return null;

  return (
    <div className="popup-backdrop">
      <div className="popup-container">
        {loading ? (
          <p className="loading-message">Loading doctor details...</p>
        ) : error ? (
          <div>
            <p className="error-message">{error}</p>
            <button className="popup-close-btn" onClick={onClose}>
              Cancel
            </button>
          </div>
        ) : (
          <div className="popup-content">
            {/* Close Button */}
            <button className="popup-close-btn" onClick={onClose}>
              &times;
            </button>

            {/* Section 1: Profile Picture and Name */}
            <div className="popup-section section-1">
              {doctorDetails.profile_pic ? (
                <img src={doctorDetails.profile_pic} alt="Doctor Profile" className="doctor-profile-pic" />
              ) : (
                <div className="placeholder-pic">No Image</div>
              )}
              <h2 className="doctor-name">{doctorDetails.name}</h2>
              <p className="doctor-degree">{doctorDetails.degree}</p>
            </div>

            {/* Section 2: Other Details */}
            <div className="popup-section section-2">
              <p><strong>Experience:</strong> {doctorDetails.experience} years</p>
              <p><strong>Top Expertise:</strong> {doctorDetails.top_expertise || 'N/A'}</p>
              <p><strong>Phone:</strong> {doctorDetails.phone_number}</p>
              <p><strong>Email:</strong> {doctorDetails.email}</p>
              <p><strong>Description:</strong> {doctorDetails.description}</p>
              <p><strong>Hospital:</strong> {doctorDetails.hospital}</p>
              <p><strong>City:</strong> {doctorDetails.city}</p>
              <p><strong>Address:</strong> {doctorDetails.address}</p>
              <p><strong>Fees:</strong> ${doctorDetails.fees}</p>
              <p><strong>Verified:</strong> {doctorDetails.is_verified ? 'Yes' : 'No'}</p>
              <p><strong>Rating:</strong> {doctorDetails.rating.toFixed(1)}</p>
            </div>

            {/* Section 3: Services and Entities */}
            <div className="popup-section section-3">
              <h3>Services</h3>
              {doctorDetails.services?.length > 0 ? (
                <ul>
                  {doctorDetails.services.map((service, index) => (
                    <li key={index}>{service}</li>
                  ))}
                </ul>
              ) : (
                <p>No services available</p>
              )}
              <h3>Entities</h3>
              {doctorDetails.entities?.length > 0 ? (
                <ul>
                  {doctorDetails.entities.map((entity, index) => (
                    <li key={index}>{entity}</li>
                  ))}
                </ul>
              ) : (
                <p>No entities available</p>
              )}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default PopupPage;
